import React, { useState, useEffect } from 'react';
import styles from "../Styles/Doctors.module.css"
import PatientNavBar from '../Components/PatientNavBar'
import { useLocation, useNavigate, useNavigation } from 'react-router-dom';
function Hospitals() {
    const navigate=useNavigate();
    let location=useLocation();
    let id=40;
    const [hospital, setHospital] = useState([
        {
            hospitalId: 1,
            hospitalName: "Krishna",
            hospitalAddress: "Kuniamuthur"
        },
        {
            hospitalId: 2,
            hospitalName: "Kumaraguru",
            hospitalAddress: "Saravanampatti"
        },
        {
            hospitalId: 3,
            hospitalName: "KMCH",
            hospitalAddress: "Neelambur"
        },
        {
            hospitalId: 4,
            hospitalName: "KMCH",
            hospitalAddress: "Neelambur"
        },
    ])
    return (
        <>
            <PatientNavBar />
            <div>
                {
                    hospital.map((hos)=>
                        <a onClick={(e)=>{navigate(`/patient/${id}/${hos.hospitalId}`)}}>
                        <div className="box">
                            <h2>{hos.hospitalName}</h2>
                            <h2>{hos.hospitalId}</h2>
                            <h2>{hos.hospitalAddress}</h2>
                        </div>
                        </a>
                    )
                }
            </div>
        </>
    )
}

export default Hospitals
